import "./styles/style.css";
import {BrowserRouter as Router,
  Routes ,
Route,
Link
} from "react-router-dom";
import Bio from './pages/bio'
import About from './pages/About'
import Third from './pages/third'
const PREFIX_URL = '../static/';
